import React from 'react';

const writeJsonFile = require('write-json-file');

(async () => {
    await writeJsonFile('testData.json', { "status": "A" });
})();

export default function TestButton() {
    return (
        <div>

            <button>
                {"json만들기"}
            </button>
        </div>
    )
}
